// very important, if you don't know what it is, don't touch it
// 非常重要，不懂代码不要动，这里可以解决80%的问题，也可以生产1000+的bug
const hookClick = (e) => {
    // 处理 Shadow DOM 情况，优先使用 composedPath 查找
    const path = e.composedPath ? e.composedPath() : []
    const origin = path.find((el) => el.tagName === 'A') || e.target.closest('a')

    if (!origin || !origin.href) {
        return
    }

    // 处理 SVGAnimatedString (SVG中的a标签)
    const href = origin.href instanceof SVGAnimatedString ? origin.href.baseVal : origin.href

    // 过滤无效链接
    if (!href || href.startsWith('javascript:') || href.startsWith('#')) {
        return
    }

    const target = origin.target
    const isBaseTargetBlank = document.querySelector(
        'head base[target="_blank"]'
    )

    // 判断是否需要拦截：
    // 1. target 为 _blank
    // 2. target 为自定义窗口名（非 _self, _parent, _top），在 Webview 中通常无法响应
    // 3. 全局 base target 为 _blank 且当前链接未指定为 _self
    const shouldIntercept =
        target === '_blank' ||
        (target && target !== '_self' && target !== '_parent' && target !== '_top') ||
        (isBaseTargetBlank && target !== '_self')

    console.log('origin', origin, isBaseTargetBlank, 'shouldIntercept:', shouldIntercept)

    if (shouldIntercept) {
        e.preventDefault()
        console.log('handle origin', href)
        location.href = href
    } else {
        console.log('not handle origin', origin)
    }
}

window.open = function (url, target, features) {
    console.log('open', url, target, features)
    if (url) {
        location.href = url
    }
    return window
}

document.addEventListener('click', hookClick, { capture: true })
